window.bookSummaryJSON = "<p><b>Say the right words in just the right way, and step through a mirror into Mana Valley, a pocket dimension hidden on Oriceran. </b></p> <p>Are you in need of high-tech wands, shifter apps, services for the dark internet or other magical technology? Well, take a chance and enter. All that and more can be found here.&nbsp;</p> <p>Could there be a competitor on the horizon?&nbsp;</p> <p>Fran Jackson is a clever witch with big dreams of being a magi-tech entrepreneur and the know-how to make things happen. But a dark past buried in her family's legacy may get in the way.&nbsp;</p> <p>Magical monsters have begun crossing through the mirrors and attacking Fran's employees.&nbsp;</p> <p>Something dark is stirring under Mana Valley, and what it wants could transform the world in terrible ways.&nbsp;</p> <p>Will Fran and the old lineage of Evermores be able to put a stop to it before it's too late for both worlds?</p>"; 
